import React from 'react';
import "../styles/style.scss";

const PointContext = ({ title, buttons, dataList }) => {
    const renderButtons = () => {
        return buttons.map((button, index) => (
            <button
                key={index}
                style={{ backgroundColor: button.color }}
                onClick={button.onClick}
            >
                {button.text}
            </button>
        ));
    };

    const renderDataList = () => {
        return dataList.map((data, index) => (
            <div key={index}>
                <div className="data-list-title">
                    {/* 标题部分 */}
                    <p>{data.name}</p>
                </div>
                <div className="data-list-content">
                    {/* 内容部分 */}
                    <p>{data.name}</p>
                    {/* 其他内容 */}
                </div>
            </div>
        ));
    };

    return (
        <div className='point_frame'>
            <div className='point_view'>
                {/* <p className='group_view-title font24'>{title}</p> */}
                <section className='point_view-context'>
                    {renderDataList()}
                </section>
            </div>
            <div className='group_btn'>
                {renderButtons()}
            </div>
        </div>
    );
};

export default PointContext;
